import React from 'react'


export default function Filter({filterData,filterTopic}){

    return(
        <div>
            {
                filterData.map((data)=>{
                return(
                    <button key={data.id} onClick={filterTopic(data.id)}> {data.title}</button>
                )
            })
            }
        </div>
    )
}
